import React from 'react';
import { MdEdit, MdDelete } from 'react-icons/md';
import PropTypes from 'prop-types';
import { useDispatch } from 'react-redux';

import { Container, Button } from './styles';
import ButtonMore from '../../../components/ButtonMore';
import history from '../../../services/history';
import * as RecipientActions from '../../../store/modules/recipient/actions';

export default function EntregadorTabela({ data, updateDeliveryman }) {
  const dispatch = useDispatch();

  function handleDelete() {
    var confirmDelete = window.confirm(
      `Você tem certeza que deseja deletar o destinatário ${data.name}?`
    );

    if (confirmDelete === true) {
      dispatch(RecipientActions.deleteRequest(data.id));
      updateDeliveryman();
    } else {
      history.push('/destinatarios');
    }
  }

  return (
    <Container>
      <small>#{data.id}</small>
      <small>
        <img src={data.avatar.url} alt="" />
      </small>
      <small>{data.name}</small>
      <small>{data.email}</small>

      <ButtonMore>
        <Button>
          <div>
            <button
              onClick={() => history.push(`/destinatario/${data.id}`)}
              type="button"
            >
              <MdEdit color="#4D85EE" size={10} />
              <span>Editar</span>
            </button>
          </div>
          <div>
            <button onClick={handleDelete} type="button">
              <MdDelete color="#DE3B3B" size={10} />
              <span>Excluir</span>
            </button>
          </div>
        </Button>
      </ButtonMore>
    </Container>
  );
}

EntregadorTabela.propTypes = {
  data: PropTypes.shape({
    id: PropTypes.number,
    name: PropTypes.string,
    email: PropTypes.string,
    avatar: PropTypes.shape({
      url: PropTypes.string,
      name: PropTypes.string,
      path: PropTypes.string,
    }),
  }).isRequired,
  updateDeliveryman: PropTypes.func.isRequired,
};
